<style>
  * {
    font-family: 'Cabin', sans-serif;
    margin: 0;
    padding: 0;
    box-sizing: border-box;
  }


  .tooltip-inner {
    margin-right: 50px;
    background-color: #efcca2;
    color: #800000;
    border-radius: 4px;
    font-size: 20px;
    display: flex;
    align-items: center;
    justify-content: center;
    z-index: 100;
    padding-right: 5px;
  }

  .ghg {
    color: #800000;
    width: 40px;
  }

  #image,
  #image1,
  #image2,
  #image3,
  #image4,
  #image5,
  #image6,
  #image7,
  #image8,
  #image9,
  #image10,
  #image11,
  #image12 {
    height: 70px;
    position: absolute;
    display: none;
  }

  img {
    width: 140px;
  }

  svg {
    width: 100%;
    height: auto;
  }

  nav {
    position: fixed;
    background-color: transparent;
    z-index: 100;
    width: 100%;
    height: 4rem;
    display: flex;
    align-items: center;
    justify-content: flex-end;
    box-shadow: rgba(80, 90, 93, 0.55) 0px 30px 60px -12px inset, rgba(0, 0, 0, 0.3) 0px 18px 36px -18px inset;
  }

  nav li {
    list-style: none;
    padding: 0 1rem;

  }

  nav ul {
    display: flex;
    align-items: center;
    justify-content: flex-end;
  }

  nav li a {
    color: whitesmoke;
    display: flex;
    /* margin: 5px 5px; */
    font-weight: bold;
    text-decoration: none;
  }

  nav li a:hover {
    color: maroon;
    transition: 500ms;
  }

  @media screen and (max-width:600px) {
    svg {
      /* width: 100vw; */
      height: 100vh;
    }

    nav ul {
      margin-right: 0;

    }

    nav li a {
      display: flex;
      align-items: center;
      justify-content: center;
      margin: 0;
      font-size: small;
    }

    nav li {
      padding: 10px;
      display: flex;
      align-items: center;
    }

    #image,
    #image1,
    #image2,
    #image3,
    #image4,
    #image5,
    #image6,
    #image7,
    #image8,
    #image9,
    #image10,
    #image11,
    #image12 {
      height: 20px;
      width: auto;
      position: absolute;
    }
  }

  .inst {
    background-color: rgb(225, 202, 202);
    font-size: medium;
    color: maroon;
    position: absolute;
    padding: 5px 10px;
    bottom: 7px;
    left: 40%;
  }
</style>

    <i class="fa-solid fa-arrow-pointer"></i> Click on the Floor of your Interest
